//get items from axios
import axios from "axios";
import { useEffect, useState } from "react";
type ItemType = {
    id: String;
    name: String;
    description: String;
    price: number;
    image: String;
};
const fetch = "http://localhost:8080/api/menu/getAllMenu";
export default function getItems() {
    const [items, setItems] = useState<ItemType[]>([]);
    useEffect(() => {
        axios.get(fetch).then((res) => {
            setItems(res.data);
        });
    }, []);
    return (
        <div>
            {items.map((item) => (
                <div key={item.id}>
                    <img srcSet={item.image} alt="item" />
                    <h1>{item.name}</h1>
                    <p>{item.description}</p>
                    <p>{item.price}</p>
                </div>
            ))}
        </div>
    );
}
